import React from "react";
import { useSelector } from "react-redux";

export default function Checkout() {
  let answer = useSelector((state) => state.cart.cart);
  console.log(answer);
  return (
    <div className="container">
      <h1>Checkout</h1>
      <table className="table">
        <thead>
          <tr>
            <th>Image</th>
            <th>Name</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {answer &&
            answer.map((value) => (
              <tr>
                <td>
                  <img
                    src={"http:localhost:8080/uploads/" + value.path}
                    alt="Prod img"
                    className="img-fluid"
                    width="100px"
                  />
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
}
